import React from 'react'
import { Form, ToggleButton, ToggleButtonGroup } from 'react-bootstrap';

/*
export default function FederationForm({federations}){
  return (
    <div>
      <Form>
      { federations.map(federation => {
          return (
            <Form.Check
            type="switch"
            id="custom-switch"
            label={federation}
            />
          )
          })
        }
      </Form>
    </div>
  )
}
*/
